    <script>
        $(function () {
            function loadHeaderCart() {
                $(""#miniCart"").load(""/AjaxContent/HeaderCart"");
                $(""#numberCart"").load(""/AjaxContent/NumberCart"");

            }
            $("".removecart"").click(function () {
                var productid = $(this).attr(""data-mahh"");
                $.ajax({
                    url: '/api/cart/remove',
                    type: ""POST"",
                    dataType: ""JSON"",
                    data: {
                        productId: productid
                    },

                    success: function (result) {
                        if (result.success) {
                            loadHeaderCart();
                            window.location = 'cart.html';
                        }
                    },
                    error: function (rs) {
                        alert(""Cập nhật Cart Error!"");
                    }
                });
            });
            $("".cart");
                WriteLiteral(@"Item"").click(function () {
                    var productid = $(this).attr(""data-mahh"");
                    var soluong = parseInt($(this).val());
                    $.ajax({
                        url: ""/api/cart/update"",
                        type: ""POST"",
                        dataType: ""JSON"",
                        data: {
                            productId: productid,
                            amount: soluong
                        },
                        success: function (result) {
                            if (result.success) {
                                loadHeaderCart();
